import { Box } from 'grommet';

export default function TaskBoard() {
  return (
		<Box round="medium" direction="row" pad="medium" justify="around" fill>
			<Box fill round="medium" elevation="large">
				To Do
			</Box>
			<Box fill justify="center" gap="medium" round="medium" elevation="large">
				In Progress
			</Box>
			<Box fill round="medium" elevation="large">
				Done
			</Box>
		</Box>
  );
}
